import "./App.css";

const App = () => (
    <div className="App container">
        <div className="row">
            <div className="col-12">
                <div className="card mt-5" style={{ maxWidth: "370px" }}>
                    <div className="row no-gutters"></div>
                </div>
            </div>
        </div>
    </div>
);

export default App;
